sparqlQuery:
PREFIX  dbo:  <http://dbpedia.org/ontology/>
PREFIX  res:  <http://dbpedia.org/resource/>
PREFIX  rdf:  <http://www.w3.org/1999/02/22-rdf-syntax-ns#>

SELECT DISTINCT  ?uri
WHERE
  { ?uri  rdf:type       dbo:Book ;
          dbo:publisher  res:Viking_Press ;
          dbo:author     res:Jack_Kerouac
  }

PREFIX  dbo:  <http://dbpedia.org/ontology/>
PREFIX  res:  <http://dbpedia.org/resource/>
PREFIX  rdf:  <http://www.w3.org/1999/02/22-rdf-syntax-ns#>

SELECT DISTINCT  ?uri
WHERE
  { ?uri  rdf:type     dbo:RecordLabel ;
          dbo:genre    res:Grunge ;
          dbo:country  res:Canada
  }

PREFIX  dbo:  <http://dbpedia.org/ontology/>
PREFIX  dct:  <http://purl.org/dc/terms/>
PREFIX  dbc:  <http://dbpedia.org/resource/Category:>
PREFIX  dbr:  <http://dbpedia.org/resource/>
PREFIX  rdf:  <http://www.w3.org/1999/02/22-rdf-syntax-ns#>

SELECT  (COUNT(DISTINCT ?uri) AS ?count)
WHERE
  {   { ?uri  dbo:location  dbr:South_Carolina ;
              rdf:type      dbo:Lake
      }
    UNION
      { ?uri  dct:subject  dbc:Rivers_and_streams_of_South_Carolina }
  }

PREFIX  dbo:  <http://dbpedia.org/ontology/>
PREFIX  res:  <http://dbpedia.org/resource/>
PREFIX  rdf:  <http://www.w3.org/1999/02/22-rdf-syntax-ns#>

SELECT DISTINCT  ?uri
WHERE
  { ?uri  rdf:type      dbo:Film ;
          dbo:starring  res:Julia_Roberts ;
          dbo:starring  res:Richard_Gere
  }

PREFIX  dbo:  <http://dbpedia.org/ontology/>
PREFIX  res:  <http://dbpedia.org/resource/>
PREFIX  rdf:  <http://www.w3.org/1999/02/22-rdf-syntax-ns#>

SELECT DISTINCT  ?uri
WHERE
  { ?uri  dbo:knownFor  res:Manhattan_Project ;
          rdf:type      dbo:Scientist ;
          dbo:knownFor  res:Nobel_Peace_Prize
  }

PREFIX  dbo:  <http://dbpedia.org/ontology/>
PREFIX  res:  <http://dbpedia.org/resource/>
PREFIX  rdf:  <http://www.w3.org/1999/02/22-rdf-syntax-ns#>

SELECT DISTINCT  ?uri
WHERE
  { ?uri  rdf:type           dbo:Book ;
          dbo:author         res:William_Goldman ;
          dbo:numberOfPages  ?x
    FILTER ( ?x > 300 )
  }

PREFIX  dbo:  <http://dbpedia.org/ontology/>
PREFIX  res:  <http://dbpedia.org/resource/>
PREFIX  rdf:  <http://www.w3.org/1999/02/22-rdf-syntax-ns#>

SELECT DISTINCT  ?uri
WHERE
  { ?uri  rdf:type      dbo:Film ;
          dbo:starring  res:Mickey_Rourke ;
          dbo:director  res:Guy_Ritchie
  }

PREFIX  dbo:  <http://dbpedia.org/ontology/>
PREFIX  dct:  <http://purl.org/dc/terms/>
PREFIX  dbc:  <http://dbpedia.org/resource/Category:>
PREFIX  rdf:  <http://www.w3.org/1999/02/22-rdf-syntax-ns#>

SELECT DISTINCT  ?uri
WHERE
  { ?uri  rdf:type     dbo:Person ;
          dct:subject  dbc:American_assassins ;
          dct:subject  dbc:Assassination_of_William_McKinley
  }

PREFIX  dbo:  <http://dbpedia.org/ontology/>
PREFIX  res:  <http://dbpedia.org/resource/>
PREFIX  rdf:  <http://www.w3.org/1999/02/22-rdf-syntax-ns#>

SELECT DISTINCT  ?uri
WHERE
  { ?film  rdf:type      dbo:Film ;
           dbo:country   res:Spain ;
           dbo:producer  res:Benicio_del_Toro ;
           dbo:starring  ?uri .
    ?uri   rdf:type      dbo:Person
  }
